var configModels3 = [{"title":"编制说明","contentCode":"101-01-01-DJ-01","content":"     我公司经过认真研究招标文件和施工图纸，仔细考察工程现场，针对工程所处位置的交通状况、地上地下综合管线进展调查，并结合我们在房屋建设工程中的施工经验和施工工艺技术，组织了本工程项目经理与主要项目管理人员编制本施工组织设计。在本工程组织设计编制中，充分考虑了各关键部位和重点工序与相互间的衔接、协调的可行性，与其实现的施工技术方案和工艺操作方法，特别是针对工程现场的交通情况、地上地下管线和可能对本工程产生的影响，作了充分的估计和准备。\n      本施工组织设计是根据招标人提供的设计施工图纸、招标文件与答疑文件和现场考察结果，根据现行国家规范、标准，结合我公司多年来的施工经验，针对本工程的具体情况和要求，经屡次研究论证和方案比拟，提出了我方中标将如何组织施工的总体框架构想。\n      本方案主要从“施工整体布署、关键点和技术难点的控制措施、施工方案与技术措施、质量管理体系与措施、安全量管理体系与措施、环境保护管理体系与措施、工程进度计划与措施、施工主要机械设备与人力资源配置、施工总体布置、质量通病的防治措施、采用“四新”技术的方案与措施等几大方面提出构想，宗旨是能为招标人更好地服务。如我公司中标，将在施工中进一步深化完善。为实现本工程“优质、快速、安全、低耗”的施工目标，我们将“用我们的智慧和行动，实现对用户的承诺”。","selected":1},{"title":"内容完整性","contentCode":"101-01-02-DJ-01","content":"       {\"pdfImgName\":\"\",\"width\":814.5,\"height\":1446,\"src\":\"data:image/png;base64,\"}","selected":1},{"title":"编制依据","contentCode":"101-03-01-DJ-01","content":"{\"pdfImgName\":\"\",\"width\":508,\"height\":474,\"src\":\"data:image/jpeg;base64,\"}\n{\"pdfImgName\":\"\",\"width\":507,\"height\":782,\"src\":\"data:image/jpeg;base64,\"}\n      注：施工过程中用到的包括但不限于以上规范。","selected":1},{"title":"编制原则","contentCode":"101-03-02-DJ-01","content":"      1.全面响应招标文件原则\n      编制本投标文件以及后续施工中，我公司将全面响应招标文件《合同条件》、《技术条款》和其它要求，严格履行合同，在工程质量、安全、进度、环境保护和水土保持、文明施工等方面，争创佳绩。\n      2.质量创优原则\n      我公司在本工程施工的质量目标是“优良”。为达到该质量目标，我们将加强领导，强化管理，贯彻执行ISO9002质量体系标准，运用合理的技术精心施工和科学的质量检测方法进行控制，确保实现质量目标。\n      3.进度保证原则\n      根据业主对本工程的工期要求，编制科学、合理、周密的施工方案，利用先进的项目管理技术，合理安排进度，实行网络控制，重点做好工序间的衔接，实时监控进度，确保实现工期目标。\n      4.安全保护原则\n      在施工组织设计编制中，始终按照技术可靠、措施得力、确保安全的原则确定施工方案，制定详细有效的监测方案，采取相应的预防和应急技术措施，重要岗位操作工保证持证上岗，安全措施落实到位，确保万无一失。\n      5.环境保护原则\n      本工程涉及施工废弃物排放、卫生防疫、景观与视觉保护、噪声控制、粉尘控制、扰民与污染控制、水土保持、生态保护等多方面问题。结合具体情况，我们将采取积极、严密的环保措施，尽可能减少施工对河流和周边环境的影响，按照国家有关环境保护的法律法规，编制施工区和生活区的环保措施计划并严格执行。\n      6.合理布局原则\n      根据本标段工程的任务量和管理目标的要求，考虑地形地貌特征，在临时工程的施工布置上，特别是风、水、电、浆等管线以及道路、各种场地的设置，充分利用业主提供的场地，本着避免干扰、就近布置、方便适用、优化设置的原则，合理布局。\n      7.科学配置原则\n      根据本工程的任务量和管理目标的要求，实行科学配置。在人、财、物、设备等方面，科学合理配置，既保证施工需要，又避免资源浪费。","selected":1}];